            console.log(`Pending confirmation email sent`);
        }).catch((error) => {
            console.log(error);
        });

        axios.put("/api/cityrunner/riderupdatestatustopending", data)
        .then(() => {
            console.log(`status update: to "pending", id of: ${data._id}`);

        }).catch((error) => {
            console.log(error);
        });

        axios.put(`/api/cityrunner/adminassignrider2`, data)
        .then(() => {
            console.log(`rider assignment`);
            history.push("/admindashboardpending");
        }).catch((error) => {
            console.log(error); 
        }); 


        console.log("done");

    }

const AssignOrderRider3 = () => {


    axios.post("/api/cityrunner/orderpending", data) 
    .then((res) => {
        console.log(`Pending confirmation email sent`);
    }).catch((error) => {
        console.log(error);
    });

        axios.put("/api/cityrunner/riderupdatestatustopending", data)
        .then(() => {
            console.log(`status update: to "pending", id of: ${data._id}`);

        }).catch((error) => {
            console.log(error);
        });

        axios.put(`/api/cityrunner/adminassignrider3`, data)
        .then(() => {
            console.log(`rider assignment`);
            history.push("/admindashboardpending");
        }).catch((error) => {
            console.log(error); 
        }); 


        console.log("done"); 

    }

    return (
        <tr>     
           <td /*onClick = {SubmitOrder}*/>
                {props.id}
            </td>
            <td>
                {props.user}
            </td>
            <td>
                {props.pickupitem} 
            </td>
            <td>
                {props.pickupaddress}  
            </td>
            <td>
                {props.name}
            </td>
            <td>
                {props.phone}
            </td>
            <td>
                {props.email}
            </td>
            <td>
                {props.pickupdate}
            </td>
            <td>
               {props.amountInNaira} 
            </td>
            <td>
               {props.weightinkg} 
            </td>
            <td>
                {props.pickupquantity}
            </td>
            <td>
                {props.deliveryaddress}
            </td>
            <td>
                {props.deliveryname}
            </td>
            <td>
                {props.deliveryphonenumber}
            </td>
            <td>
                {props.deliveryemail}
            </td>
            <td>
                {props.status}
            </td> 
            <td onClick = {AssignOrderRider1} className="orangeandunderline">
                Assign To Rider 1
            </td>  
            <td onClick = {AssignOrderRider2} className="orangeandunderline"> 
                Assign to Rider 2
